import DashboardContent from "../components/DashboardContent";

const AnalyticsPage = () => {
    return (
        <div className="flex flex-col items-center justify-center w-full lg:w-auto">
            <DashboardContent />
        </div>
    );
}

export default AnalyticsPage;
